import React from 'react';

class NAVBAR extends React.Component {
  render() {
    return (
      <header>
        <div className='bg-black fixed w-full h-11 items-center grid grid-cols-2 lg:grid-cols-3'>
          <div className='flex justify-center items-center'><a className='bg-red-600' href="/">Home</a></div>
          <div className='items-center justify-end right-5 flex lg:hidden '>
          <nav className=''>
            <button className='translate-y-1 top-2 mr-5' id="hamburger">
              <div className='bg-white mb-1.5 w-7 h-1 rounded-md'></div>
              <div className='bg-white mb-1.5 w-7 h-1 rounded-md'></div>
              <div className='bg-white w-7 h-1 rounded-md'></div>
            </button>
            <div className='bg-green-500 right-0 mt-2 border-1 border-black rounded-lg absolute'>
              <ul className='w-32'>
              <li className='mt-2'>
              <div className='bg-white justify-center items-center justify-items-center flex text-xl'><a href="/">About Me</a></div>
              </li>
              <li className='mt-5'>
              <div className='bg-white justify-center items-center justify-items-center flex text-xl ml-5 mr-5 rounded-lg'><a href="/">Projects</a></div>
              </li>
              <li className='mt-5'>
              <div className='bg-white justify-center items-center justify-items-center flex text-xl'><a href="/">Contact</a></div> 
              </li>
            </ul>
            </div>
          </nav>
          </div>
        </div> 
      </header>
    );
  }
}

function App() {
  return (
    <div className="App">
      <NAVBAR />
    </div>
  );
}

export default App;
